    # def minCut(s:str)->int:

    #     dp =[ 0 for _ in range(len(s)+1 )]

    #     for i in range(1,len(s)):
    #         if s[:i] == s[:i][::-1]:
    #             dp[i]= dp[i-1]+1

    #     pass

        # to do check the str and finish the loop
    def minCut(self, s: str) -> int:
        if s[:] == s[::-1]:
            return 0
        ans = 65535
        for i in range(1, len(s)):
            if s[:i] == s[:i][::-1]:
                ans = min(ans, self.minCut(s[i:]) + 1)
        return ans


